use projetojsp;

drop table ALUNOS;

create table ALUNOS(
    ra varchar(7) not null,
    nome varchar(45) not null,
    cpf varchar(11) not null,
    email varchar(45) not null,
    ano integer not null,
    curso varchar(30) not null,
    modalidade varchar(30) default '',
    primary key (ra)
);



select * from ALUNOS;